      <Grid item
        style={{
          margin : '30px',
        }}>
        <Box display='flex' justifyContent='center' P={3}>
          <Typography variant="h2">CA TECH CHALLENGE STORE</Typography>
        </Box>
      </Grid>

      <Grid item p={3}>
        <Content />
      </Grid>

    </Grid>

  );
}

export default App;
